ON ([Target].[Id] = [Source].[Id])
WHEN MATCHED AND (
	NULLIF([Source].[CidId], [Target].[CidId]) IS NOT NULL OR NULLIF([Target].[CidId], [Source].[CidId]) IS NOT NULL OR 
	NULLIF([Source].[Name], [Target].[Name]) IS NOT NULL OR NULLIF([Target].[Name], [Source].[Name]) IS NOT NULL) THEN
 UPDATE SET
  [Target].[CidId] = [Source].[CidId], 
  [Target].[Name] = [Source].[Name]
WHEN NOT MATCHED BY TARGET THEN
 INSERT([Id],[CidId],[Name])
 VALUES([Source].[Id],[Source].[CidId],[Source].[Name])
WHEN NOT MATCHED BY SOURCE THEN 
 DELETE;

